import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
          <i><h3>Peripatetik LLC</h3></i>
        <p>"a disciple of Aristotle, one of the set of philosophers who followed the teachings of Aristotle"</p>
      </header>
    </div>
  );
}

export default App;
